import React from 'react';
import { Row, Col, Menu } from 'antd';
import { DownSquareOutlined } from '@ant-design/icons';

const AppLayout = ({ children }) => {
    return (
        <>
            <Menu>

            </Menu>
            <Row gutter={[16, 16]}>
                <Col md={5}>
                <DownSquareOutlined />
                </Col>

                <Col md={14}>
                    {children}
                </Col>

                <Col md={5}>

                </Col>
            </Row>
        </>
    )
}

export default AppLayout;
